// DNS records template
const DNS_RECORDS_TEMPLATE = (domain, ip, dkimValue) => [
  // Mail A records
  { type: 'A', name: 'mail', content: ip, ttl: 14400, proxied: false },
  { type: 'A', name: 'webmail', content: ip, ttl: 14400, proxied: false },

  // MX Record
  { type: 'MX', name: '@', content: `mail.${domain}.`, priority: 10, ttl: 14400 },

  // SPF Record
  { type: 'TXT', name: '@', content: `"v=spf1 a mx ip4:${ip} -all"`, ttl: 14400 },

  // DMARC Record
  { type: 'TXT', name: '_dmarc', content: '"v=DMARC1; p=quarantine; pct=100"', ttl: 14400 },

  // DKIM Record
  { type: 'TXT', name: 'mail._domainkey', content: dkimValue, ttl: 3600 },

  // Domainkey Policy
  { type: 'TXT', name: '_domainkey', content: '"t=y; o=~;"', ttl: 3600 }
];

// Fetch zone ID
async function getZoneId(domain) {
  const res = await fetch(`https://api.cloudflare.com/client/v4/zones?name=${domain}`, {
    headers: {
      'Authorization': `Bearer ${API_TOKEN}`,
      'Content-Type': 'application/json'
    }
  });

  const data = await res.json();
  if (!data.success || data.result.length === 0) {
    throw new Error(`Zone not found for ${domain}`);
  }

  return data.result[0].id;
}

// Create DNS record
async function createDNSRecord(zoneId, record) {
  const res = await fetch(`https://api.cloudflare.com/client/v4/zones/${zoneId}/dns_records`, {
    method: 'POST',
    headers: {
      'Authorization': `Bearer ${API_TOKEN}`,
      'Content-Type': 'application/json'
    },
    body: JSON.stringify(record)
  });

  const data = await res.json();
  if (!data.success) {
    throw new Error(`Failed to create record: ${JSON.stringify(data.errors)}`);
  }

  return data.result;
}

// Process one domain
async function processDomain(domainConfig) {
  const { domain, dkim } = domainConfig;
  console.log(`🌐 Processing ${domain}...`);
  
  try {
    const zoneId = await getZoneId(domain);
    const records = DNS_RECORDS_TEMPLATE(domain, IP, dkim);

    for (const record of records) {
      await createDNSRecord(zoneId, record);
      console.log(`✅ Created ${record.type} record for ${record.name}.${domain}`);
    }

    console.log(`✅ Finished ${domain}\n`);
  } catch (err) {
    console.error(`❌ Error for ${domain}: ${err.message}`);
  }
}

// Main function
async function main() {
  console.log("🚀 Starting DNS configuration...\n");
  for (const domainConfig of DOMAINS) {
    await processDomain(domainConfig);
  }
  console.log("🎉 All domains processed.");
}

main();